import React from 'react';
import { Image, Grid } from 'semantic-ui-react';
import cover from '../static/cover.png';
import NavigationBar from './Sidebar.jsx';

class Wrapper extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
      container: 'route1'
    };
  };

  render() {
    return(
        <Grid>
        <Grid.Row>
            <Grid.Column width={1}>
              <NavigationBar />
            </Grid.Column>
            <Grid.Column width={15}>
              <Image src = {cover} size = 'medium' centered/>
            </Grid.Column>
          </Grid.Row>
        </Grid>
  )};
};

export default Wrapper;
